import React, { useEffect, useState } from "react";
import api from "../../../../../service/api";
import { Body, ContainerDouble, ContainerList, ContainerListText, FormCoitainer, MonitorList } from "./styled";



const FinishPez = () => {
    const [monitores, setMonitores] = useState([])

    const getMonitor = () => {
        api.get('/takemonitor')
        .then((res) => {
            setMonitores(res.data)
        })
        .catch((err) => {
            console.log(err)
        })
    }

    useEffect(() => {
        getMonitor()
    },[])

    return(
        <Body>
            <FormCoitainer>
                <ContainerDouble>
                    <MonitorList>
                    {monitores.map((itens) => {
                        return(
                            <ContainerList key={itens.id}>
                                <ContainerListText>{itens.name}</ContainerListText>
                            </ContainerList>
                        )
                    })}
                    </MonitorList>
                </ContainerDouble>
            </FormCoitainer>
        </Body>
    )
}

export default FinishPez;
